/* Minden widget és konténer sarkának lekerekítése */
.widget, .container {
    border-radius: 12px !important;
    overflow: hidden !important; /* Hogy a tartalom ne lógjon ki a lekerekítésen */
}

/* Külön a féderek csúszka-gombja (handle) */
.widget .handle {
    border-radius: 8px !important;
}

/* Külön a gombok és beviteli mezők */
.widget.button, .widget.input {
    border-radius: 12px !important;
}

/* A féderek belső sínje (track) */
.widget .track {
    border-radius: 12px !important;
}

